def phase(num=''):
    sum_digits = 0
    for item in list(num):
        sum_digits += int(item)

    num_list = []
    for iteration in range(0, len(num)):
        num_list += [str(sum_digits)[-1]]
        sum_digits -= int(num[iteration])

    num_str = ''.join(num_list)
    return num_str


original = signal
number = original * 10000
offset = int(number[0:7])
number = str(number)[offset:]

for c in range(0, 100):
    number = phase(number)
    print(f'Done phase {c+1}!', number)

